import React from 'react';
import { Switch, Route } from 'react-router-dom';

import './App.css';

import HomePage from './pages/homepage/homepage.component';

const BlogPage = () => (
	<div>
		<h1>BLOG</h1>
	</div>
);


function App() {
  return (
    <div>
     <Switch>
    	<Route exact path='/' component={HomePage} />
    	<Route path='/blog' component={HomePage} />
     </Switch>
    </div>
  );
}

export default App;
